import React from 'react'

const footerComps = (props) => {
  return (
    <div>
      <span>{props.title}</span>
      <ul>
        {props.list.map((item) => {
          return <li>{item}</li>
        })}
      </ul>
    </div>
  )
}

export default footerComps
